import React from 'react'
import NavItem from './NavItem'
import { Outlet } from "react-router-dom";

export default function Navigation(){
    return(
        <div class="bg-black flex flex-wrap justify-center w-full py-5">
            <NavWrap>
                <NavItem path="/" label="Home Page"></NavItem>
                <NavItem path="/models" label="Inner Page"></NavItem>
            </NavWrap>
            <Outlet />
        </div>
    )
    }
